description:
Storyline: Fast-paced action feature starring Channing Tatum, Jamie Foxx and Maggie Gyllenhaal in which the White House comes under attack. When Washington DC policeman John Cale (Tatum)'s interview for the Secret Service goes badly, it seems he will be denied the chance to serve President James Sawyer (Foxx). However, when a group of paramilitaries under the command of Stenz (Jason Clarke) launch an assault on the White House and take Sawyer hostage, Cale is offered an unexpected opportunity to redeem himself. Attempting to protect his daughter Emily (Joey King) on one hand and to take down a gang of highly trained mercenaries on the other, Cale will have to prove his mettle in spectacular style if he is to save the nation and its president from the evil designs of Stenz. Will he be up to the task?


